import React from "react";
import MainCom from "./MainCom";
import SubTextBox from "./SubTextBox";


const About = () =>{
    return(
        <section className="About">
        <MainCom 
            heading="About Us"
        />
        <SubTextBox 
                        
                        subheading = ""
                        heading = "Welcome To Al-ASR"
                        para = {<>
                            A trusted provider of agricultural inputs for farmers. Our mission is to empower our growers with the tools they need to grow healthy, sustainable crops that feed our communities. Al-ASR Group was founded on the principles of integrity, innovation, and customer service. We are committed to providing high-quality products that are effective, while also offering personalized support and expertise to help our customers succeed. <br/><br/>
                        At Al-ASR Group, we believe in the power of agriculture to nourish and sustain our world. We are proud to support farmers and growers with the latest technology and best practices, and to contribute to a thriving agricultural economy. Thank you for choosing Al-ASR Group. We look forward to working with you and helping you achieve to your goals. Now Al-ASR Group, a diversified Pakistani conglomerate, leads the way in sustainable agriculture, FMCG, and Animal feed sectors.
                        </>}
                        imgsrc="Images/Al-Asr.png"
                        bg = "#FFF"
                        tOrder = "1"
                        pOrder = "2"
                        
                    />


        </section>
    )
}

export default About;
